import {BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import Contact from './components/Contact';
import About from './components/About';
import Home from './components/Home';
import Login from './backend/Login_auth';
import Main_dash from './backend/dashboard/Main_dash';
import { AuthProvider } from './backend/dashboard/Auth';
import PasswordLoginWithFirebase from './backend/PasswordLoginWithFirebase';

function App(){
    return (
        <main >
        <BrowserRouter >
            <NavBar/>
            <Routes>

                <Route path='/' element={<Home/>}/>
                <Route path='/Contact' element={<Contact/>}/>
                <Route path='/About' element={<About/>}/>  
                <Route path='/login' element={<PasswordLoginWithFirebase/>}/>
                {/* <Route path='/dashboard' element={}/> */}

            </Routes>
            <Footer/>
        </BrowserRouter>
        </main>


    )
}
export default App
